import React, {Component} from "react"

// const BASE_URL = `https://giphy.p.rapidapi.com/v1/gifs/search&key=${API_KEY}`
const API_KEY = "41f3f91b13mshaa0652a8c3b96f1p165abcjsn42e270cab71c";
class Secondary extends Component {

    componentDidMount(){
        fetch(
          'https://giphy.p.rapidapi.com/v1/gifs/search/?rapidapi-key='
        )
          .then((res) => res.json())
          .then((data) => {
            console.log(data);
          });
    }

  render() {
    return (
      <div>
        <h1>Jared Manwaring</h1>
      </div>
    );
  }
}

export default Secondary
